INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("ヤマト", 3001, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 130011, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 2.1, 100, 1, 0.0, -416.5, 3001100, 2);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("ヤマト", 3001, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 130011, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 5.68, 101, 4, 0.0, -416.5, 3001101, 2);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("ヤマト", 3001, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 130011, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 0.0, 102, 1, 0.0, -416.5, 3001102, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 3002, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 130211, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 0.0, 100, 1, 0.0, -416.5, 3002100, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 3002, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 130211, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 0.0, 101, 1, 0.0, -416.5, 3002101, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 3002, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 130211, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 8.53, 102, 5, 0.0, -416.5, 3002102, 2);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 3002, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 130211, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 5.67, 103, 7, 0.0, -416.5, 3002103, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 3002, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 130211, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 0.0, 104, 1, 0.0, -416.5, 3002104, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 3004, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 130211, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 0.0, 300, 3, 0.0, -416.5, 3002300, 3);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 3005, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 130211, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 0.0, 301, 7, 0.0, -416.5, 3002400, 7);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 3003, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 130211, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 4.4, 200, 2, 0.0, -416.5, 3003200, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 3003, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 130211, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 0.0, 201, 7, 0.0, -416.5, 3003201, 7);
